########20161227,根据用户名展示不同产品表############
CREATE TABLE `baton`.`product_user_privilege` (
  `id`           INT          NOT NULL
  COMMENT '主键Id',
  `login_name`   VARCHAR(20)  NOT NULL
  COMMENT '登陆名',
  `user_name`    VARCHAR(20)  NOT NULL
  COMMENT '用户名',
  `product_id`   VARCHAR(50)  NOT NULL
  COMMENT '产品代码',
  `product_name` VARCHAR(200) NOT NULL
  COMMENT '产品名称',
  `Create_Time`  VARCHAR(20)  DEFAULT NULL
  COMMENT '创建时间',
  `Creator`      VARCHAR(30)  DEFAULT NULL
  COMMENT '创建人',
  `Modify_Time`  VARCHAR(20)  DEFAULT NULL
  COMMENT '修改时间',
  `Modifier`     VARCHAR(30)  DEFAULT NULL
  COMMENT '修改人',
  `Valid_Flag`   VARCHAR(2)   DEFAULT NULL
  COMMENT '有效标注 1有效 0无效',
  `Remark`       VARCHAR(500) DEFAULT NULL
  COMMENT '备注',
  PRIMARY KEY (`id`)
)
  COMMENT = '用户产品权限表';
ALTER TABLE `baton`.`product_user_privilege`
  CHANGE COLUMN `id` `id` INT(11) NOT NULL AUTO_INCREMENT
COMMENT '主键Id';

