#######20170226#########################
DROP TABLE IF EXISTS `task_info`;
CREATE TABLE `task_info` (
  `Id`          INT(20) NOT NULL AUTO_INCREMENT,
  `target`      VARCHAR(200)     DEFAULT NULL
  COMMENT '请求地址',
  `name`        VARCHAR(100)     DEFAULT NULL
  COMMENT '任务名称',
  `module`      VARCHAR(100)     DEFAULT NULL
  COMMENT '任务模块',
  `receiver`    VARCHAR(200)     DEFAULT NULL
  COMMENT '收信人列表',
  `cron`        VARCHAR(100)     DEFAULT NULL
  COMMENT '表达式',
  `param`       VARCHAR(300)     DEFAULT NULL
  COMMENT '请求参数',
  `Create_Time` VARCHAR(20)      DEFAULT NULL
  COMMENT '创建时间',
  `Creator`     VARCHAR(30)      DEFAULT NULL
  COMMENT '创建人',
  `Modify_Time` VARCHAR(20)      DEFAULT NULL
  COMMENT '修改时间',
  `Modifier`    VARCHAR(30)      DEFAULT NULL
  COMMENT '修改人',
  `Valid_Flag`  VARCHAR(2)       DEFAULT NULL
  COMMENT '有效标注1有效 0无效',
  `Remark`      VARCHAR(500)     DEFAULT NULL
  COMMENT '备注',
  PRIMARY KEY (`Id`)
)
  ENGINE = InnoDB
  AUTO_INCREMENT = 51
  DEFAULT CHARSET = utf8
  COMMENT = '任务定义表';

DROP TABLE IF EXISTS `task_record`;
CREATE TABLE `task_record` (
  `Id`          INT(20) NOT NULL AUTO_INCREMENT,
  `run_ip`      VARCHAR(200)     DEFAULT NULL
  COMMENT '请求地址',
  `task_id`     VARCHAR(100)     DEFAULT NULL
  COMMENT '任务名称',
  `result`      TINYINT(1)       DEFAULT NULL
  COMMENT '1:success;2:running;3:failed;4:exception',
  `Create_Time` VARCHAR(20)      DEFAULT NULL
  COMMENT '创建时间',
  `Creator`     VARCHAR(30)      DEFAULT NULL
  COMMENT '创建人',
  `Modify_Time` VARCHAR(20)      DEFAULT NULL
  COMMENT '修改时间',
  `Modifier`    VARCHAR(30)      DEFAULT NULL
  COMMENT '修改人',
  `Valid_Flag`  VARCHAR(2)       DEFAULT NULL
  COMMENT '有效标注1有效 0无效',
  `Remark`      VARCHAR(500)     DEFAULT NULL
  COMMENT '备注',
  PRIMARY KEY (`Id`)
)
  ENGINE = InnoDB
  AUTO_INCREMENT = 51
  DEFAULT CHARSET = utf8
  COMMENT = '任务执行表';

